import React from 'react'
import './Coins.css'


const Coin = ({ title, url }) => {
    return(
        <div class="card" style={{width: '100%'}}>
        <img src={url} class="card-img-top" alt="..." />
        <div class="card-body">
          <p class="card-text">{title}</p>
        </div>
      </div>
    )
}

export default Coin;
